// ClientTable.js
import React from "react";

const ClientTable = ({ clients, onSelect }) => {
  return (
    <table>
      <thead>
        <tr>
          <th>Name</th>
          <th>Address</th>
          <th>Email</th>
          {/* Add other columns as needed */}
        </tr>
      </thead>
      <tbody>
        {clients.map((client) => (
          <tr key={client.id} onClick={() => onSelect(client)}>
            <td>{client.name}</td>
            <td>{client.address}</td>
            <td>{client.email}</td>
            {/* Render other client details */}
          </tr>
        ))}
      </tbody>
    </table>
  );
};

export default ClientTable;
